///\n/// @author Greg Wardwell\n/// @group Fonts\n////\n\n/// The base font size\n/// @group Fonts\n/// @type pixels\n$base-font-size: 16px !default;\n\n/// The normal font stack. Should be inherited from the body tag.\n/// @link http://admin.sweetwater.com/styleguide/identity/sweetwater/fonts/?font=Sweetwater\n/// @link http://admin.sweetwater.com/styleguide/website/fonts/\n/// @link http://admin.sweetwater.com/styleguide/identity/sweetwater/fonts/\n/// @type list\n$font-stack: (\n    \'Sweetwater\',\n    \'Helvetica\',\n    \'Arial\',\n    sans-serif,\n) !default;\n\n/// The condensed font stack. Note: there is no italic variations for these fonts.\n/// @link http://admin.sweetwater.com/styleguide/identity/sweetwater/fonts/?font=Sweetwater%20Condensed\n/// @link http://admin.sweetwater.com/styleguide/website/fonts/\n/// @link http://admin.sweetwater.com/styleguide/identity/sweetwater/fonts/\n/// @type list\n$font-stack-condensed: (\n    \'Sweetwater Condensed\',\n    \'Arial Narrow\',\n    \'Trebuchet MS\',\n    sans-serif,\n) !default;\n\n/// The monospace font stack.\n/// @type list\n$font-stack-mono: (\n    \'Courier New\',\n    \'Courier\',\n    monospace\n) !default;\n\n/// Font weight strings and their numerical value combinations\n/// @type map\n$font-weights: (\n    thin:       100,\n    normal:     400,\n    semi-bold:  600,\n    extra-bold: 800,\n) !default;\n\n/// Thin weight, normal font-stretch, normal font family\n/// @require {variable} font-stack\n/// @require {function} font-weight\n%font-thin {\n    font-family: $font-stack;\n    font-stretch: normal;\n    font-weight: font-weight(thin);\n}\n\n/// Normal weight, normal font-stretch, normal font family\n/// @require {variable} font-stack\n/// @require {function} font-weight\n%font-normal {\n    font-family: $font-stack;\n    font-stretch: normal;\n    font-weight: font-weight(normal);\n}\n\n/// Semi-bold weight, normal font-stretch, normal font family\n/// @require {variable} font-stack\n/// @require {function} font-weight\n%font-semi-bold {\n    font-family: $font-stack;\n    font-stretch: normal;\n    font-weight: font-weight(semi-bold);\n}\n\n/// Extra-bold weight, normal font-stretch, normal font family\n/// @require {variable} font-stack\n/// @require {function} font-weight\n%font-extra-bold {\n    font-family: $font-stack;\n    font-stretch: normal;\n    font-weight: font-weight(extra-bold);\n}\n\n// Condensed font-stretch, condensed font family\n/// @require {variable} font-stack-condensed\n%font-condensed {\n    font-family: $font-stack-condensed;\n    font-stretch: condensed;\n}\n\n/// Normal weight, condensed font-stretch, condensed font family\n/// @require {variable} font-stack-condensed\n/// @require {function} font-weight\n%font-condensed-normal {\n    font-family: $font-stack-condensed;\n    font-stretch: condensed;\n    font-weight: font-weight(normal);\n}\n\n/// Semi-bold weight, condensed font-stretch, condensed font family\n/// @require {variable} font-stack-condensed\n/// @require {function} font-weight\n%font-condensed-semi-bold {\n    font-family: $font-stack-condensed;\n    font-stretch: condensed;\n    font-weight: font-weight(semi-bold);\n}\n\n/// Extra-bold weight, condensed font-stretch, condensed font family\n/// @require {variable} font-stack-condensed\n/// @require {function} font-weight\n%font-condensed-extra-bold {\n    font-family: $font-stack-condensed;\n    font-stretch: condensed;\n    font-weight: font-weight(extra-bold);\n}\n\n////\n/// @author Greg Wardwell\n////\n\n/// Add a default semi-transparent black active/focus style\n/// - for Mobile\n%active-focus {\n    &:focus,\n    &:active {\n        background-color: rgba(0, 0, 0, 0.07);\n    }\n}\n\n/// Hide text, usually used for image replacement\n%hide-text {\n    overflow: hidden;\n    text-decoration: none;\n    text-indent: 100%;\n    white-space: nowrap;\n}\n\n/// Base line-clamp styles\n%line-clamp {\n    /* stylelint-disable property-no-vendor-prefix */\n    -webkit-box-orient: vertical;\n    display: box;\n    -webkit-line-clamp: 2;\n    overflow: hidden;\n    text-overflow: ellipsis;\n    /* stylelint-enable */\n}\n\n/// Disable text highlighting (desktop and mobile)\n%no-text-highlight {\n    -webkit-touch-callout: none;\n    user-select: none;\n}\n\n/// Activate overflow scrolling touch\n%overflow-scrolling-touch {\n    -webkit-overflow-scrolling: touch;\n}\n\n/// Reset text size\n/// - for iOS\n%text-size-adjust {\n    text-size-adjust: 100%;\n}\n\n/// Button variant generator\n/// Generate a button variant, either independently or as an extension of the default styles.\n/// @author Greg Wardwell\n/// @link http://alistapart.com/article/dry-ing-out-your-sass-mixins\n/// @param {string} $background   - button background color\n/// @param {string} $border-color - button border color, implemented as a box shadow (optional)\n/// @param {string} $color        - button text color (optional)\n/// @param {bool}   $adjust-color - Flag for whether the color should be adjusted (true) or background (false)\n/// @param {bool}   $extend       - flag for whether (true) or not (false) to extend the original button styles\n///\n/// @example scss - Use\n/// \t.foo {\n/// \t\t@include button(#f00);\n/// \t}\n/// \t.bar {\n/// \t\t@include button(#00f);\n/// \t}\n/// @example css - Output\n/// \t.foo {\n/// \t\tbackground-color: red\n/// \t}\n/// \t.foo, .bar {\n/// \t\tappearance: none;\n/// \t\tborder: none;\n/// \t\tborder-radius: 3px;\n/// \t\tcursor: pointer;\n/// \t\tdisplay: inline-block;\n/// \t\tfont-size: inherit;\n/// \t\tfont-weight: 600;\n/// \t\tposition: relative;\n/// \t\ttext-align: center;\n/// \t\ttext-decoration: none;\n/// \t\tuser-select: none\n/// \t}\n/// \t.foo:hover {\n/// \t\tbackground-color: #e60000\n/// \t}\n/// \t.foo:active {\n/// \t\tbackground-color: #d60000\n/// \t}\n/// \t.foo, .foo:link, .foo:visited, .foo:active,\n/// \t.foo:hover, .foo:active,\n/// \t.bar, .bar:link, .bar:visited, .bar:active,\n/// \t.bar:hover, .bar:active {\n/// \t\tcolor: #fff\n/// \t}\n/// \t.bar {\n/// \t\tbackground-color: blue\n/// \t}\n/// \t.bar:hover {\n/// \t\tbackground-color: #0000e6\n/// \t}\n/// \t.bar:active {\n/// \t\tbackground-color: #0000d6\n/// \t}\n///\n@mixin button($background, $border-color: null, $color: null, $adjust-color: false, $extend: true) {\n    // Borders\n    $border: inset 0 0 0 1px;\n    $border-default: null;\n    $border-hover: null;\n    $border-active: null;\n\n    // Text color\n    @if not $color {\n        $color: contrast-color($background);\n    }\n\n    @if ($background != transparent) {\n        @if $adjust-color {\n            $color: accessible-contrast($color, $background, true);\n        } @else {\n            $background: accessible-contrast($background, $color, true);\n        }\n    }\n\n    @if not $border-color and $color == $contrasted-dark-default {\n        $border-color: rgba(0, 0, 0, 0.1);\n    }\n\n    @if $border-color {\n        $border-default: #{$border} $border-color;\n    }\n\n    // Set the attributes\n    background-color: $background;\n    box-shadow: $border-default;\n\n    @include button-extend($extend);\n\n    &:hover {\n        background-color: darken($background, 5%);\n        box-shadow: $border-default;\n    }\n\n    &:focus,\n    &:active {\n        background-color: darken($background, 8%);\n        box-shadow: $border-default;\n    }\n\n    &,\n    &:link,\n    &:visited,\n    &:hover,\n    &:focus,\n    &:active {\n        @include dynamic-extend(\'color-#{$color}\') {\n            color: $color;\n        }\n    }\n}\n\n/// Defines (initial run) or extends (subsequent runs) the default button styles.\n/// @link http://alistapart.com/article/dry-ing-out-your-sass-mixins\n/// @param {bool} $extend - flag to generate (false) or extend (true) the button style.\n/// @example scss - Use\n/// \t.foo {\n/// \t\t@include button-extend(true);\n/// \t}\n/// \t.bar {\n/// \t\t@include button-extend(true);\n/// \t}\n/// @example css - Output\n/// \t.foo, .bar {\n/// \t\tappearance: none;\n/// \t\tborder: none;\n/// \t\tborder-radius: 3px;\n/// \t\tcursor: pointer;\n/// \t\tdisplay: inline-block;\n/// \t\tfont-size: inherit;\n/// \t\tfont-weight: 600;\n/// \t\tposition: relative;\n/// \t\ttext-align: center;\n/// \t\ttext-decoration: none;\n/// \t\tuser-select: none\n/// \t}\n///\n@mixin button-extend($extend: true) {\n    $button-selector: map-get($placeholder-selectors, \'button\');\n\n    @if $extend == true {\n        @include dynamic-extend(\'button\') {\n            @include button-extend(false);\n        }\n    } @else {\n        appearance: none;\n        border: 0;\n        border-radius: 2px;\n        cursor: pointer;\n        display: inline-block;\n        font-family: inherit;\n        font-size: inherit;\n        font-weight: 600;\n        line-height: 1;\n        text-align: center;\n        text-decoration: none;\n        user-select: none;\n\n        &::-moz-focus-inner {\n            border: 0;\n            padding: 0;\n        }\n\n        &:visited,\n        &:hover,\n        &:active {\n            text-decoration: none;\n        }\n    }\n}\n\n/// Truncates the number of lines of a block of text to a defined count.\n///\n/// Extends the line-clamp placeholder,\n/// generating custon line-clamp count if necessary\n///\n/// @param {int} $line-count [$line-count-default] - the number of lines the text will be truncated to.\n///\n/// @requires $line-count-default\n/// @requires %line-clamp\n///\n/// @example scss - Use: Truncating to two lines (default)\n/// \t.foo {\n/// \t\t@include line-clamp();\n/// \t}\n///\n/// @example css - Output: Truncating to two lines (default)\n/// \t.foo {\n/// \t\toverflow: hidden;\n/// \t\ttext-overflow: ellipsis;\n/// \t\tdisplay: -webkit-box;\n/// \t\t-webkit-line-clamp: 2;\n/// \t\t-webkit-box-orient: vertical\n/// \t}\n///\n/// @example scss - Use: Truncating to four lines\n/// \t.foo {\n/// \t\t@include line-clamp(4);\n/// \t}\n///\n/// @example css - Output: Truncating to four lines\n/// \t.foo {\n/// \t\toverflow: hidden;\n/// \t\ttext-overflow: ellipsis;\n/// \t\tdisplay: -webkit-box;\n/// \t\t-webkit-line-clamp: 2;\n/// \t\t-webkit-box-orient: vertical\n/// \t}\n/// \t.foo {\n/// \t\t-webkit-line-clamp: 4;\n/// \t}\n@mixin line-clamp($line-count: $line-count-default) {\n    @if $line-count != $line-count-default {\n        -webkit-line-clamp: $line-count;\n    }\n\n    @extend %line-clamp;\n}\n\n/// Generates cross-browser placeholder styling\n///\n/// @param {color} $color   - The text color. Use rgba for transparent text.\n///\n/// @example scss - Use\n/// \t.foo {\n/// \t\t@include placeholder {\n///             color: #f00;\n///         }\n/// \t}\n///\n/// @example css - Output\n/// \t.foo::-moz-placeholder {\n/// \t\tcolor: #f00;\n/// \t}\n/// \t.foo:-ms-input-placeholder {\n/// \t\tcolor: #f00;\n/// \t}\n/// \t.foo::-webkit-input-placeholder {\n/// \t\tcolor: #f00;\n/// \t}\n@mixin placeholder {\n    $placeholder-prefixes: (\n        \'::-moz-placeholder\',\n        \':-ms-input-placeholder\',\n        \'::-webkit-input-placeholder\',\n    );\n\n    @each $value in $placeholder-prefixes {\n        &#{$value} {\n            @content;\n        }\n    }\n}\n\n/// Sizes star ratings to fit within a given dimension.\n///\n/// @param {int} $width  [null] - the bounding width (optional)\n/// @param {int} $height [null] - the bounding height (optional)\n@mixin rating-size($width: null, $height: null) {\n    @if $width != null or $height != null {\n        @if $width == null {\n            $width: $height * 5;\n        }\n\n        @if $height == null {\n            $height: $width * 0.2;\n        }\n\n        height: $height;\n        width: $width;\n    }\n}\n\n/// Compass "contrast" function\n/// Determines whether to use a predefined light or dark color\n/// to contrast with the provided color.\n///\n/// @link https://github.com/Compass/compass/blob/stable/core/stylesheets/compass/utilities/color/_contrast.scss\n/// @author Compass\n///\n/// @param {color} $background-color                  - the background color being calculated against\n/// @param {color} $dark  [$contrasted-dark-default]  - the dark contrast color\n/// @param {color} $light [$contrasted-light-default] - the light contrast color\n///\n/// @require {variable} contrasted-dark-default\n/// @require {variable} contrasted-light-default\n///\n/// @return {string} Either the `$light` or `$dark` color\n/// by deciding which contrasts more with `$color`.\n/// E.g. This can be used to select the more readable foreground color\n/// for a given background color. When `$color` is `null`, this function returns `null`.\n@function contrast-color($color, $dark: $contrasted-dark-default, $light: $contrasted-light-default) {\n    @if $color == null {\n        @return null;\n    } @else {\n        $color-brightness: brightness($color);\n        $dark-text-brightness: brightness($dark);\n        $light-text-brightness: brightness($light);\n\n        @return if(abs($color-brightness - $light-text-brightness) > abs($color-brightness - $dark-text-brightness), $light, $dark);\n    }\n}\n\n/// Compass "contrasted" function\n/// Sets the specified background color and calculates a dark or light\n///\n/// @link https://github.com/Compass/compass/blob/stable/core/stylesheets/compass/utilities/color/_contrast.scss\n/// @author Compass\n///\n/// @param {color} $background-color                  - the background color being calculated against\n/// @param {color} $dark  [$contrasted-dark-default]  - the dark contrast color\n/// @param {color} $light [$contrasted-light-default] - the light contrast color\n///\n/// @require $contrasted-dark-default\n/// @require $contrasted-light-default\n/// @require contrast-color\n///\n/// @example scss - Use\n/// \t.foo {\n/// \t\t@include contrasted(#000);\n/// \t}\n///\n/// @example css - Output\n/// \t.foo {\n/// \t\tbackground-color: #000;\n/// \t\tcolor: #fff\n/// \t}\n@mixin contrasted($background-color, $dark: $contrasted-dark-default, $light: $contrasted-light-default) {\n    background-color: $background-color;\n    color: contrast-color($background-color, $dark, $light);\n}\n\n/// Compass clearfix mixin\n/// A way to clear child elements.\n///\n@mixin clearfix {\n    &::after {\n        clear: both;\n        content: \'\';\n        display: table;\n    }\n}\n\n/// Compass font-smoothing mixin\n/// To smooth the heck out of fonts\n@mixin font-smoothing($value: antialiased) {\n    @if $value == antialiased {\n        -webkit-font-smoothing: antialiased;\n    } @else {\n        -webkit-font-smoothing: subpixel-antialiased;\n    }\n}\n\n/// Retina image mixins\n@mixin image-2x($image, $width, $height) {\n    @include media(\'retina2x\') {\n        background-image: url($image);\n        background-size: $width $height;\n    }\n}\n\n/// Background image mixin\n@mixin background-image-2x($url, $width, $height, $size: auto, $repeat: no-repeat, $position: center center, $bgcolor: #fff) {\n    $url-2x: \'\';\n\n    @if str-index($url, \'webp\') == null {\n        $url-2x: str-insert($url, \'@2x\', str-length($url) - 3);\n    } @else {\n        $url-2x: str-insert($url, \'@2x\', str-length($url) - 4);\n    }\n\n    @if ($width != \'\' or $height != \'\') and $size != \'cover\' {\n        background-size: $width $height;\n    } @else {\n        background-size: $size;\n    }\n\n    background-color: $bgcolor;\n    background-image: url($url);\n    background-position: $position;\n    background-repeat: $repeat;\n\n    @include media(\'retina2x\') {\n        @if ($width != \'\' or $height != \'\') and $size != \'cover\' {\n            background-size: $width $height;\n        } @else {\n            background-size: $size;\n        }\n\n        background-color: $bgcolor;\n        background-image: url($url-2x);\n        background-position: $position;\n        background-repeat: $repeat;\n    }\n}\n\n/// Vertical-align mixin\n/// Vertically align basically anything (supported down to IE 9)\n/// @param {position} $position - The position of the element\n@mixin vertical-align($position: relative) {\n    position: $position;\n    top: 50%;\n    transform: translateY(-50%);\n}\n\n/// Horizontal-align mixin\n/// Horizontally align basically anything (supported down to IE 9)\n/// @param {position} $position - The position of the element\n@mixin horizontal-align($position: relative) {\n    left: 50%;\n    position: $position;\n    transform: translateX(-50%);\n}\n\n/// Middle-align mixin\n/// Horizontally & vertically align basically anything (supported down to IE 9)\n/// @param {position} $position - The position of the element\n@mixin middle-align($position: relative) {\n    left: 50%;\n    position: $position;\n    top: 50%;\n    transform: translate(-50%, -50%);\n}\n\n/// Hide an element from sight while preserving screen reading compatibility.\n@mixin visually-hidden {\n    clip: rect(0 0 0 0);\n    clip: rect(0, 0, 0, 0);\n    height: 1px;\n    margin: -1px;\n    overflow: hidden;\n    padding: 0;\n    position: absolute;\n    width: 1px;\n}\n\n/// Adds box sizing code\n/// @param {String} $sizing - The box-sizing format for the box. Can be `content-box`, `border-box`, `initial`, `inherit`, or `unset`.\n@mixin box-sizing($size: border-box) {\n    box-sizing: unquote($size);\n\n    *,\n    *::before,\n    *::after {\n        box-sizing: inherit;\n    }\n}\n\n/// Applies provided style rules to one or more active selector states.\n/// @param {Arglist} $states - One or more states that the style rules should be applied to.\n@mixin active-selectors($states...) {\n    $link-default-states: (\'hover\', \'focus\', \'active\');\n    $link-states-sort-order: (\'link\', \'visited\', \'hover\', \'focus\', \'active\');\n\n    // If no states were passed, use the default states\n    @if length($states) == 0 {\n        $states: $link-default-states;\n    }\n\n    // Sort the states\n    $states: quick-sort($states, $link-states-sort-order);\n\n    // Generate the selector\n    $link-selector: ();\n\n    @each $state in $states {\n        $link-selector: append($link-selector, \'&:#{$state}\', \'comma\');\n    }\n\n    #{$link-selector} {\n        @content;\n    }\n}\n\n$grid-col-min: 1;\n$grid-col-max: 12;\n$grid-gutter-width: 32px;\n$breakpoint-aliases: (\n    xsmall: xs,\n    small: sm,\n    medium: md,\n    large: lg,\n);\n\n@mixin float-grid-columns($size) {\n    $list: ();\n    $size-string: \'\';\n\n    @if $size {\n        $size-string: \'#{$size}-\';\n    }\n\n    @for $i from $grid-col-min through $grid-col-max {\n        $list: append($list, \'.grid-col-#{$size-string}#{$i}\', comma);\n    }\n\n    #{$list} {\n        float: left;\n    }\n}\n\n@mixin calc-grid-column($index, $size, $type) {\n    $size-string: \'\';\n\n    @if $size {\n        $size-string: \'#{$size}-\';\n    }\n\n    @if ($type == width) and ($index > 0) {\n        .grid-col-#{$size-string}#{$index} {\n            width: percentage(math.div($index, $grid-col-max));\n\n            @supports (display: grid) {\n                grid-column-end: auto;\n                grid-column-start: span $index;\n                width: auto;\n            }\n        }\n    }\n\n    @if ($type == push) and ($index > 0) {\n        .grid-col-#{$size-string}push-#{$index} {\n            left: percentage(math.div($index, $grid-col-max));\n\n            @supports (display: grid) {\n                left: auto;\n            }\n        }\n    }\n\n    @if ($type == push) and ($index == 0) {\n        .grid-ol-#{$size-string}push-0 {\n            left: auto;\n\n            @supports (display: grid) {\n                left: auto;\n            }\n        }\n    }\n\n    @if ($type == pull) and ($index > 0) {\n        .grid-col-#{$size-string}pull-#{$index} {\n            right: percentage(math.div($index, $grid-col-max));\n\n            @supports (display: grid) {\n                right: auto;\n            }\n        }\n    }\n\n    @if ($type == pull) and ($index == 0) {\n        .grid-col-#{$size-string}pull-0 {\n            right: auto;\n\n            @supports (display: grid) {\n                right: auto;\n            }\n        }\n    }\n\n    @if ($type == offset) {\n        .grid-col-#{$size-string}offset-#{$index} {\n            margin-left: percentage(math.div($index, $grid-col-max));\n\n            @supports (display: grid) {\n                margin-left: 0;\n            }\n        }\n    }\n\n    @if ($type == start) {\n        .grid-col-#{$size-string}start-#{$index} {\n            @supports (display: grid) {\n                grid-column-start: $index;\n            }\n        }\n    }\n\n    @if ($type == end) {\n        .grid-col-#{$size-string}end-#{$index} {\n            @supports (display: grid) {\n                grid-column-end: $index;\n            }\n        }\n    }\n}\n\n@mixin loop-grid-columns($size, $type) {\n    @for $i from $grid-col-min through $grid-col-max {\n        @include calc-grid-column($i, $size, $type);\n    }\n}\n\n@mixin make-grid($size: null) {\n    @include float-grid-columns($size);\n    @include loop-grid-columns($size, width);\n    @include loop-grid-columns($size, pull);\n    @include loop-grid-columns($size, push);\n    @include loop-grid-columns($size, offset);\n    @include loop-grid-columns($size, start);\n    @include loop-grid-columns($size, end);\n}\n\n@mixin make-grids {\n    @include make-grid();\n    @include make-grid(xs);\n\n    @each $bp, $size in $breakpoint-aliases {\n        @if $size != \'xs\' {\n            @include media(\'>=#{$bp}\') {\n                @include make-grid($size);\n            }\n        }\n    }\n}\n\n@mixin make-grid-columns {\n    $list: ();\n\n    // Add generic cols\n    @for $i from $grid-col-min through $grid-col-max {\n        $list: append($list, \'.grid-col-#{$i}\', comma);\n    }\n\n    // Add size specific cols\n    @each $bp, $size in $breakpoint-aliases {\n        @for $i from $grid-col-min through $grid-col-max {\n            $list: append($list, \'.grid-col-#{$size}-#{$i}\', comma);\n        }\n    }\n\n    #{$list} {\n        // Prevent columns from collapsing when empty\n        min-height: 1px;\n\n        // Inner gutter via padding\n        padding-left: ceil(($grid-gutter-width * 0.5));\n        padding-right: floor(($grid-gutter-width * 0.5));\n        position: relative;\n\n        @supports (display: grid) {\n            padding-left: 0;\n            padding-right: 0;\n        }\n    }\n\n    .grid-row--gutterless > #{$list} {\n        padding-left: 0;\n        padding-right: 0;\n    }\n}\n\n@mixin make-grid-row {\n    .grid-row {\n        @supports (display: grid) {\n            display: grid;\n            grid-column-gap: $grid-gutter-width;\n            grid-row-gap: $grid-gutter-width;\n            grid-template-columns: repeat($grid-col-max, 1fr);\n        }\n    }\n\n    .grid-row--gutterless {\n        @supports (display: grid) {\n            grid-column-gap: 0;\n            grid-row-gap: 0;\n        }\n    }\n}\n\n@mixin grid {\n    @include make-grid-row;\n    @include make-grid-columns;\n    @include make-grids;\n}\n',"@charset \"UTF-8\";\n\n//     _            _           _                           _ _\n//    (_)          | |         | |                         | (_)\n//     _ _ __   ___| |_   _  __| | ___   _ __ ___   ___  __| |_  __ _\n//    | | '_ \\ / __| | | | |/ _` |/ _ \\ | '_ ` _ \\ / _ \\/ _` | |/ _` |\n//    | | | | | (__| | |_| | (_| |  __/ | | | | | |  __/ (_| | | (_| |\n//    |_|_| |_|\\___|_|\\__,_|\\__,_|\\___| |_| |_| |_|\\___|\\__,_|_|\\__,_|\n//\n//      Simple, elegant and maintainable media queries in Sass\n//                        v1.4.9\n//\n//        https://eduardoboucas.github.io/include-media\n//\n//         Authors: Eduardo Boucas (@eduardoboucas)\n//                  Kitty Giraudel (@kittygiraudel)\n//\n//      This project is licensed under the terms of the MIT license\n////\n/// include-media library public configuration\n/// @author Eduardo Boucas\n/// @access public\n////\n\n\n///\n/// Creates a list of global breakpoints\n///\n/// @example scss - Creates a single breakpoint with the label `phone`\n///  $breakpoints: ('phone': 320px);\n///\n$breakpoints: (\n  'phone': 320px,\n  'tablet': 768px,\n  'desktop': 1024px\n) !default;\n\n\n///\n/// Creates a list of static expressions or media types\n///\n/// @example scss - Creates a single media type (screen)\n///  $media-expressions: ('screen': 'screen');\n///\n/// @example scss - Creates a static expression with logical disjunction (OR operator)\n///  $media-expressions: (\n///    'retina2x': '(-webkit-min-device-pixel-ratio: 2), (min-resolution: 192dpi)'\n///  );\n///\n$media-expressions: (\n  'screen': 'screen',\n  'print': 'print',\n  'handheld': 'handheld',\n  'landscape': '(orientation: landscape)',\n  'portrait': '(orientation: portrait)',\n  'retina2x': '(-webkit-min-device-pixel-ratio: 2), (min-resolution: 192dpi), (min-resolution: 2dppx)',\n  'retina3x': '(-webkit-min-device-pixel-ratio: 3), (min-resolution: 350dpi), (min-resolution: 3dppx)'\n) !default;\n\n\n///\n/// Defines a number to be added or subtracted from each unit when declaring breakpoints with exclusive intervals\n///\n/// @example scss - Interval for pixels is defined as `1` by default\n///  @include media('>128px') {}\n///\n///  /* Generates: */\n///  @media (min-width: 129px) {}\n///\n/// @example scss - Interval for ems is defined as `0.01` by default\n///  @include media('>20em') {}\n///\n///  /* Generates: */\n///  @media (min-width: 20.01em) {}\n///\n/// @example scss - Interval for rems is defined as `0.1` by default, to be used with `font-size: 62.5%;`\n///  @include media('>2.0rem') {}\n///\n///  /* Generates: */\n///  @media (min-width: 2.1rem) {}\n///\n$unit-intervals: (\n  'px': 1,\n  'em': 0.01,\n  'rem': 0.1,\n  '': 0\n) !default;\n\n///\n/// Defines whether support for media queries is available, useful for creating separate stylesheets\n/// for browsers that don't support media queries.\n///\n/// @example scss - Disables support for media queries\n///  $im-media-support: false;\n///  @include media('>=tablet') {\n///    .foo {\n///      color: tomato;\n///    }\n///  }\n///\n///  /* Generates: */\n///  .foo {\n///    color: tomato;\n///  }\n///\n$im-media-support: true !default;\n\n///\n/// Selects which breakpoint to emulate when support for media queries is disabled. Media queries that start at or\n/// intercept the breakpoint will be displayed, any others will be ignored.\n///\n/// @example scss - This media query will show because it intercepts the static breakpoint\n///  $im-media-support: false;\n///  $im-no-media-breakpoint: 'desktop';\n///  @include media('>=tablet') {\n///    .foo {\n///      color: tomato;\n///    }\n///  }\n///\n///  /* Generates: */\n///  .foo {\n///    color: tomato;\n///  }\n///\n/// @example scss - This media query will NOT show because it does not intercept the desktop breakpoint\n///  $im-media-support: false;\n///  $im-no-media-breakpoint: 'tablet';\n///  @include media('>=desktop') {\n///    .foo {\n///      color: tomato;\n///    }\n///  }\n///\n///  /* No output */\n///\n$im-no-media-breakpoint: 'desktop' !default;\n\n///\n/// Selects which media expressions are allowed in an expression for it to be used when media queries\n/// are not supported.\n///\n/// @example scss - This media query will show because it intercepts the static breakpoint and contains only accepted media expressions\n///  $im-media-support: false;\n///  $im-no-media-breakpoint: 'desktop';\n///  $im-no-media-expressions: ('screen');\n///  @include media('>=tablet', 'screen') {\n///    .foo {\n///      color: tomato;\n///    }\n///  }\n///\n///   /* Generates: */\n///   .foo {\n///     color: tomato;\n///   }\n///\n/// @example scss - This media query will NOT show because it intercepts the static breakpoint but contains a media expression that is not accepted\n///  $im-media-sup